%jdbc(phoenix) 
//to rerun this script from scratch delete the view created for the pre-existing hbase table
drop view if exists "timeseries"

%jdbc(phoenix)
//if restarting this demonstration delete the temp table sinusoid
drop table if exists "sinusoid"

%jdbc(phoenix)
//upsert date from the raw data table
UPSERT INTO "phoenix-ts" SELECT TO_DATE(TO_CHAR(TO_NUMBER("t")/1000,'#'),'ssssssssss'),TO_NUMBER("v"),"id","PKEY" FROM "timeseries"

%jdbc(phoenix) 
//select all data from the phoenix table
select * from "phoenix-ts"
